import React from 'react';
import './App.css'; // Create this file for global styles
import HomePage from './components/HomePage';
import ForestPage from './components/ForestPage';
import BeachPage from './components/BeachPage';
import UrbanPage from './components/UrbanPage';
import ScrollWrapper from './components/ScrollWrapper';

function App() {
  return (
    <div className="App">
      <ScrollWrapper>
        <HomePage />
        <ForestPage />
        <BeachPage />
        <UrbanPage />
      </ScrollWrapper>
    </div>
  );
}

export default App;
